 contract MyContract{
//Mapping >> Datatypes lets you store key value pair in blockchain

// Syntex mapping(key => value) myMapping;
    mapping(uint => Book) public books;
    mapping(uint => string) names;
    
    struct Book{
        string title;
        string author;
    }



    constructor() public {
        names[1]  = "Adam";
        names[2] = "Bruce";
        names[3]  = "Carl";
    }

    


 }

